import React from 'react'

export default function Card() {
    
    let request = new XMLHttpRequest();
    request.open("GET", "https://pixabay.com/api/?key=35904460-6da0f483724d8177c3f681e67q=yellow+flowers&image_type=photo")
    request.send();
    request.onload = () => {
        console.log(request);
    }
    
  return (
    <div>Card</div>
  )
}
